import React, { Component } from "react";
import Nav from "Components/Nav";
import Tables from "Components/Tables";
import config from "config.js";

class Cell extends Component {
  state = {
    cells: []
  };

  componentDidMount() {
    this.fetchCells();
  }

  fetchCells = async () => {
    const response = await fetch(`${config.url}cell`).then(res => res.json());

    const cells = response.map(res => {
      return res.name;
    });

    this.setState({
      cells
    });
  };

  getSingleCell = async () => {
    fetch(`${config.url}cell`);
  };

  handleClick = e => {
    this.getSingleCell();
  };

  render() {
    const { cells } = this.state;

    return (
      <>
        <Nav />
        <div className="page">
          <main>
            <div className="title">
              <span>셀 관리</span>
            </div>
            <div className="tools">
              <button onClick={this.handleClickTool}>셀 추가</button>
            </div>
            <div className="tables">
              <Tables onClick={this.handleClick} listData={cells} />
            </div>
          </main>
        </div>
      </>
    );
  }
}

export default Cell;
